options_temp = []

with open('Inferring mRNA from Protein - Codon count table.txt', 'r') as f_obj:
    reader = f_obj.readlines()
    for line in reader:
        line = line.strip()
        options_temp.append(line.split(','))

options_dict = dict(options_temp)
unique_RNA_str = 1
protein_str = ''

for aa in protein_str:
    unique_RNA_str *= int(options_dict[aa])
unique_RNA_str *= 3

print(unique_RNA_str % 1000000)
